var id = 0;
var Projet = function (nom, description, lien, photo, dateDebut, dateFin, idP) {
    var projet = {
        self : this,
        id : id++,
        nomProjet:nom,
        descriptionProjet : description,
        lienProjet : lien,
        photoProjet : photo
    };

    return projet;
};

var ProjetsDao = function () {
    var dao = {
        listeProjets: [
            ],
        getProjets : function () {
          return this.listeProjets;
        },
        getProjet : function (id) {
            for(var i in dao.listeProjets) {
                var projet = dao.listeProjets[i];
                if (projet.id == id){
                    return projet
                }
            }
        },

        addProjet : function (projet) {
            this.listeProjets.push(projet);
            this.saveLocalStorage();
        },

        delProjet : function (id) {
            for(var i in this.listeProjets) {
                var projet = this.listeProjets[i];
                if (projet.id == id) {
                    dao.listeProjets.splice(i, 1);
                    break;
                }
            }
            this.saveLocalStorage();
        },

        editProjet: function (id, p) {
            var projet = this.getProjet(id);

            projet.nomProjet = p.nomProjet;
            projet.descriptionProjet = p.descriptionProjet;
            projet.lienProjet = p.lienProjet;
            projet.photoProjet = p.photoProjet;

            this.saveLocalStorage();
        },

        loadLocalStorage : function () {
            if (window.localStorage.getItem('id') == null){
                this.listeProjets.push(new Projet("Roguelike", "Petit roguelike axé sur la génération procédurale.", "https://github.com/pasterp/RogueLike", ""));
                this.listeProjets.push(new Projet("Livre dont vous êtes le héros", "Interpréteur intéractif permettant de jouer à des histoires où le joueur a le choix lors de son aventure.", "https://github.com/pasterp/LivreDontVousEtesLeHeros/", ""));
            }else{
                id = window.localStorage.getItem('id');
                this.listeProjets = JSON.parse(window.localStorage.getItem('projets'))
            }
        },

        saveLocalStorage: function () {
            window.localStorage.setItem('id', id);
            window.localStorage.setItem('projets', JSON.stringify(this.listeProjets));
        }
    };

    dao.loadLocalStorage();
    dao.saveLocalStorage();
    return dao;
};